import React from 'react'

function Gallery() {
  return (
    <div className="Word-bank">
    <Grid
      container
      spacing={{ xs: 2, md: 3 }}
      columns={{ xs: 5, sm: 5, md: 5 }}
    >
      {wordList.map((_, index) => (
        <Grid item xs={1} sm={1} md={1} key={index}>
          <Item>{_}</Item>
        </Grid>
      ))}
    </Grid>
  </div>
  )
}

export default Gallery
